== プロジェクトの目的  ==
環境 OSMプロジェクトの目的は次のとおりです。

* 環境データのタグ付けスキーマを改善する
* このデータを広範な環境セクターにわたって調査し、提供するための戦略を定義する
* 環境に特化した地図を作成する

