"アクティブな投稿者"の定義は以下の通りです：
自然人であって（単一または複数のアカウントを利用しているかどうかに関わらず）直近の１２カ月のうち任意の３暦月においてプロジェクトを編集した人（即ちこの期間中に興味関心の表明がある）;
かつ登録プロファイルに有効なメールアドレスが維持管理されており投票のリクエストに対して３週間以内に返信する人。

