==Basic Tagging==

===Name===

Use {{tag|taxon}} to tag identified non-native species in 'latin' bi-nominal scientific name

*{{tag|taxon|Heracleum mantegazzianum}}

For 'common' names in a particular language use a colon followed by a two letter suffix for example in English:

*{{tag|taxon:en|Giant Hogweed}} 

Or in French:

*{{tag|taxon:fr|Berce du Caucase}}

Apply to a [[node]], [[way]] or [[area]].

== 基本的なタグづけ ==

===名称===

 {{tag|taxon}} を使用して、ラテン語の二語名の学名で特定された非在来種にタグをつけます。

*{{tag|taxon|Heracleum mantegazzianum}}

特定の言語の共通名には、コロンのあとに言語を示す2文字の接尾辞をつけます。英語の場合は:

*{{tag|taxon:en|Giant Hogweed}} 

フランス語の場合は:

*{{tag|taxon:fr|Berce du Caucase}}

 [[node]]、 [[way]] 、 [[area]]に適用されます。

Examples:
*{{node|1317708316}}
*{{area|116985996}}

==Further Tagging==

====Recording Vegetation Cover Values====

If tagging an [[area]], [[way]] or [[node]] there may be reasons to record the {{tag|cover}} value of different species within an area.

例:
*{{node|1317708316}}
*{{area|116985996}}

==追加のタグづけ==

==== Recording Vegetation Cover Values ====

 [[area]]、 [[way]]や [[node]]のタグを付けるときに、エリア内の異なる種の {{tag|cover}} 値を記録する理由があるかもしれません。

Please select :
* One no self-crossing way with at most two of its nodes;
* Three nodes.

See [[Tree]] discussion page
* Vegetation coverage values for areas have been proposed at the bottom of {{tag|taxon}}
* Plant communities (National Vegetation Classification) proposal outlined in {{tag|plant_community}}
* Habitat mapping proposal based on the Phase One Habitat survey in the {{tag|habitat}} page

