From a '''research''' perspective, OpenStreetMap is deservedly attracting a lot of attention from universities and similar institutions, and from academic scholars in 'geomatics', 'neogeography', 'volunteered geo-information' (VGI), 'digital cartography', 'participatory geoinformatics' etc.

{{Languages|Research}}
{{Translation not complete}}

{{otheruses|OSMの学校での活動|link=JA:教育}}
{{otheruses|研究所のタグ付け|link=JA:Tag:amenity%3Dresearch_institute}}
{{otheruses|研究開発事務所のタグ付け|link=JA:Tag:office%3Dresearch}}

OpenStreetMapは'''研究'''の観点から、大学や大学と同様の組織から当然のこととして注目を集めています。地理情報学、ネオ地理学、VGI（ボランタリー地理情報）、デジタル地図作成、参加型の地球情報学の学者達からも注目されています。

